import React, { useState, useEffect } from 'react';
import { FiPhone, FiArrowUp, FiArrowDown } from 'react-icons/fi';

const CallLogPage = () => {
  const [callLogs, setCallLogs] = useState([]);

  useEffect(() => {
    // Simulating API call to fetch call logs
    const fetchCallLogs = async () => {
      // Replace this with actual API call
      const mockLogs = [
        { id: 1, name: 'John Doe', number: '+1 234 567 890', type: 'incoming', date: '2023-06-15', time: '14:30' },
        { id: 2, name: 'Jane Smith', number: '+1 987 654 321', type: 'outgoing', date: '2023-06-14', time: '09:45' },
        { id: 3, name: 'Alice Johnson', number: '+1 555 123 456', type: 'missed', date: '2023-06-13', time: '18:20' },
        // Add more call logs as needed
      ];
      setCallLogs(mockLogs);
    };

    fetchCallLogs();
  }, []);

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-2xl mx-auto">
        <h2 className="text-2xl font-bold mb-6 text-gray-800 dark:text-white">Call Log</h2>
        <div className="space-y-4">
          {callLogs.map(log => (
            <div key={log.id} className="bg-white dark:bg-gray-800 p-4 rounded-lg shadow-md flex items-center justify-between">
              <div>
                <h3 className="text-lg font-semibold text-gray-800 dark:text-white">{log.name}</h3>
                <p className="text-gray-600 dark:text-gray-300">{log.number}</p>
                <p className="text-sm text-gray-500 dark:text-gray-400">{log.date} at {log.time}</p>
              </div>
              <div className="flex items-center">
                {log.type === 'incoming' && <FiArrowDown className="text-green-500 mr-2" />}
                {log.type === 'outgoing' && <FiArrowUp className="text-blue-500 mr-2" />}
                {log.type === 'missed' && <FiPhone className="text-red-500 mr-2" />}
                <span className="capitalize text-gray-600 dark:text-gray-300">{log.type}</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CallLogPage;
